INSERT INTO `comment` (`id`, `ulasan`, `createdAt`, `updatedAt`) VALUES
(48, '\"Saya baru saja kembali dari liburan luar biasa di Ketapang. Tempat ini benar-benar surganya wisatawan! Pantai-pantai yang indah, budaya yang sarat akan makna, dan kuliner lezat membuat pengalaman ini tak terlupakan. Peran pemandu di sini sangat membantu saya dalam mengeksplor spot-spot terindah yang ada di Ketapang. Saya pasti akan kembali lagi suatu hari.\"', '2023-12-06 04:12:35', '2023-12-06 04:12:35'),
(49, '\"Pelayanan tour guide yang diberikan adalah pemandu yang sangat berpengetahuan dan penuh semangat. Dia menjelaskan sejarah dan cerita menarik tentang setiap tempat yang kami kunjungi di Ketapang. Pemandu juga memberikan rekomendasi restoran yang luar biasa di seluruh perjalanan. Kami merasa sangat beruntung telah memilih Discover Ketapang sebagai pemandu wisata kami.\"', '2023-12-06 04:12:52', '2023-12-06 04:12:52'),
(50, '\"Saya ingin berterima kasih kepada tour guide kami, yang membuat perjalanan kami begitu berkesan. Dia sangat berpengetahuan tentang sejarah dan budaya destinasi kami dan mampu menjelaskannya dengan cara yang menarik. Pemandu wisata juga sangat perhatian terhadap kebutuhan kami dan memberikan rekomendasi makanan yang luar biasa. â€œ', '2023-12-06 04:13:09', '2023-12-06 04:13:09'),
(62, 'Additionally, ensure that your model (UlasanModel.js) and database connection are correctly set up and that the request body for the Komen route contains the required data (e.g., ulasan). If the issue persists, you might want to check the detailed error message in your server logs to get more information on what went wrong.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(72, 'haloo semua', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(73, 'ghvghfcgfdtgf', '0000-00-00 00:00:00', '0000-00-00 00:00:00');

